from bs4 import BeautifulSoup
from pandas import DataFrame

def extract_data_from_table(text):
    """Extract data from table and return a list of lists"""
    table = BeautifulSoup(text, 'html.parser')
    data = []
    headers = ['activity']
    for header in table.findAll('th'):
        headers.append(header.text)
    for row in table.findAll('tr'):
        row_data = []
        for cell in row.findAll('td'):
            row_data.append(cell.text)
        if len(row_data) > 0:
            data.append({
                **dict(zip(headers, row_data))
            })
    # create a dict with header as keys and data as values
    return data

def extract_transfer_efficiency(text):
    table = BeautifulSoup(text, 'html.parser')
    headers = {
        "activity": "graph-legend-alias pointer",
        "min": "graph-legend-value min",
        "max": "graph-legend-value max",
        "avg": "graph-legend-value avg",
        "current": "graph-legend-value current"
    }
    data = []
    for row in table.findAll('tr'):
        row_data = {}
        for header in headers:
            try:
                row_data[header] = row.findAll(class_= headers[header])[0].text
            except:
                pass
        if len(row_data) > 0:
            data.append(row_data)
    return data
